// src/pages/Dashboard.jsx
import React from "react";
import PersonalCard from "../components/PersonalCard";
import WorkCard from "../components/WorkCard";
import TasksToday from "../components/TasksToday";
import TasksWeekly from "../components/TasksWeekly";
import InspirationCard from "../components/InspirationCard";
import WeatherWidget from "../components/WeatherWidget";
import CalendarCard from "../components/CalendarCard";
import QuoteWidget from "../components/QuoteWidget";
import NotesCard from "../components/NotesCard";



function Dashboard() {
  return (
    <div className="min-h-screen bg-[#fdfbf7] font-serif">
      {/* Header */}
      <div className="text-center py-12">
        <h1 className="text-5xl tracking-wide mb-2">WELCOME BACK</h1>
        <h2 className="text-xl font-sans font-medium">My Dashboard.</h2>
      </div>

      {/* Main Content */}
      <div className="max-w-7xl mx-auto px-8 grid grid-cols-1 md:grid-cols-3 gap-10">
        {/* Left Column */}
        <div className="space-y-8">
          <PersonalCard />
          <WorkCard />
          <CalendarCard />
        </div>

        {/* Middle Column */}
        <div className="space-y-8">
          <TasksToday />
          <TasksWeekly />
          <NotesCard />
          
        </div>

        {/* Right Column */}
        <div className="space-y-8">
          <WeatherWidget />
          <InspirationCard />
          <QuoteWidget />
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
